import { createIcon } from "../icon/createIcon";

export const TriangleRightIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="TriangleRightIcon">
    <path d="m3.5 1 5 5-5 5z" />
  </svg>,
  "TriangleRight",
  "triangle right"
);
